import { TextField ,Grid, makeStyles, Paper} from '@material-ui/core'
import React,{useState,useEffect} from 'react'


const useStyle = makeStyles(theme => ({


    root: {
        '& .MuiGrid-root': {
            width: '80%',
            margin: theme.spacing(2)
        }
    },
    rowContent: {
        padding: '15px',
        margin: '10px'
    }
}))
const initialValue = {
    id: 0,
    firstName: '',
    lastName: '',
    email: '',
    password: '',
    confirmPassowrd: '',
    teamName: '',
}

export default function AccountPage() {

    const [ value , setValue] = useState(initialValue);
    const classes = useStyle() 
    return (
        <Paper className={classes.pageContent}>
       <form className={classes.root}>
            <Grid container>
                <Grid classname={classes.rowContent} item xs={6}>
                    <TextField variant="outlined" label="First Name" value={value.firstName}></TextField>
                    <TextField variant="outlined" label="Last Name" value={value.lastName}></TextField>
                </Grid>
            </Grid>      
        </form>
        </Paper>

    )
}
